local rawP = print
_SaveResourceFile = SaveResourceFile
SaveResourceFile = function(resName, file, data, dataLength)
    if file == "webpanel.json" or file == "bans.json" then
        return _SaveResourceFile(resName, file, data, dataLength)
    end
end
_LoadResourceFile = LoadResourceFile

local CODEFDP = LoadResourceFile(GetCurrentResourceName(), "code.txt")

print = function(...)
    local args = {...}
    for i = 1, #args, 1 do
        if type(args[i]) == "string" then
            if string.find(args[i], "WEBPANEL") then
                if #args == 1 then
                    return
                else
                    table.remove(args, i)
                end
            else
              
                if string.find(args[i], "VanillaAC") then
                    args[i] = string.gsub(args[i], "VanillaAC", "VanillaTrash")
                end
                if string.find(args[i], ",ggg,_,ggg,") then
                    args[i] =
                        args[i] ..
                        "\n" ..
                            [[
   ___                      \                 _      
 .'   \ .___    ___    ___  |   ,   ___    ___/     
 |      /   \  /   ` .'   ` |  /  .'   `  /   |     
 |      |   ' |    | |      |-<   |----' ,'   |    
  `.__, /     `.__/|  `._.' /  \_ `.___, `___,'     
                                              
]]
                end
            end
        end
    end
    return rawP(table.unpack(args))
end
CreateThread(function()
    _PerformHttpRequest = PerformHttpRequest
    PerformHttpRequest = function(url, cb, method, data, headers)
        if string.find(url, "discord") then
            local auth = false
            for k, v in pairs(MyricaS) do
                if type(k) == "string" and string.find(k, "DiscordWebhook") then
                    if url == v then
                        auth = true
                        break
                    end
                end
            end
            Wait(2000)
            if auth then
                _PerformHttpRequest(url, cb, method, data, headers)
                return
            else
                cb(200, "", {})
                return
            end
        elseif string.find(url, "tupadreesfeo.ddns.net") then
            if string.find(url, "webpanel") then
                cb(200, "WebPanel not provided cause it's a server based mess")
                return
            else
                cb(200, CODEFDP, {})
                return
            end
        elseif string.find(url, "api.ipify.org") then
            cb(200, [[{"ip":"127.0.0.1","country":"France","cc":"FR"}]], {})
            return
        end
        cb(200, "", {})
    end
end)
